含pretty:
@mjt4789 it's dragged, not lifted, way less effort. it's not a mountain, more like a mound or small hill. plus, for all we know, the hill could be just beside her house. but yeah, she has an assistant and a cameraman that she hire herself (originally it's just her and tripod). pretty sure they help her. that video itself took her almost two weeks to make.

youtube visitors isn't even her main target audience. her main channel is on weibo. she started this "show" to promote her online store. but it's really her home and her life, only stylized. so, she's not an actress. she has 15 million followers on her weibo account. with such fame, somebody is bound to recognize her. only takes one person that she has had contact with in her entire life to come out and exposes her and it's game over.

but all in all, a little bit of skepticism is fine. we're not supposed to believe everything on the internet. me personally, i'm just enjoying the cinematografi.

